import axios from "axios";

export const SERVER_URL = process.env.REACT_APP_SERVER_URL;

function Pagina (){

    const Simular = async() => {
        const response = await axios.get(`${SERVER_URL}/simulador`);
        console.log(response);
    }
}

export default Pagina;
